import { Link } from "react-router-dom";
import Input from "../components/Input";
import './Signup.css';

export default function Signup(){
    return(
        <div className="container mt-3 d-flex justify-content-center">
        <form className="form-group p-4 border rounded" style={{maxWidth:'400px'}}>
                <h2 className="text-center mb-4" >SignUp</h2>
                <Input type="text" label="Name" name="name" placeholder="Full Name" requried/>
                <Input type="number" label="Mobile No" name="mobile" placeholder="phone number" requried/>
                <Input type="email" label="Email" name="email" placeholder="example@gmail.com" requried/>
                <Input type="password" label="Password" name="password" placeholder="password" requried/>
                <button type="submit" className="btn btn-primary btn-block mt-3">Sign up</button>
                <p className="mt-3">Already User? <Link to="/login">Login here</Link></p>
            </form>
           
        </div>
    )
}
